import About from "../components/About";
import Contactme from "../components/Contactme";
import ErrorBoundary from "../components/ErrorBoundary";
import Portfolio from "./Portfolio";

const Home = () => {
    return (
      
        <>
      <ErrorBoundary>
      <About />
  </ErrorBoundary>

  <ErrorBoundary>
      <Portfolio />
  </ErrorBoundary>

  <ErrorBoundary>
      <Contactme />
  </ErrorBoundary>
  </>
    );
  };
  
  export default Home;
